    String.prototype.toHtmlEntities = function() {
        return this.replace(/./gm, function(s) {
            // return "&#" + s.charCodeAt(0) + ";";
            return (s.match(/[a-z0-9\s]+/i)) ? s : "&#" + s.charCodeAt(0) + ";";
        });
    };
    String.prototype.twoDigits = function() {
        return ("0" + this.toString()).slice(-2).toString();
    };
    Promise.sequence = function sequence(arrayOfPromises) {
        var results = [];
        return arrayOfPromises.reduce(function(seriesPromise, promise) {
          return seriesPromise.then(function() {
            return promise
            .then(function(result) {
              results.push(result);
            });
          });
        }, Promise.resolve())
        .then(function() {
          return results;
        });
    };
    Array.prototype.findLastIndex = function(predicate) {
        for (let i = this.length - 1; i >= 0; i--) {
            if (predicate(this[i], i, this)) {
                return i; 
            } 
        } return -1; 
    };
    Array.prototype.remove = function(val) {
        var index = this.indexOf(val); 
        if (index >= 0) this.splice(index, 1);
        return this;
    };
    Array.prototype.add = function(val) {
        if(!this.includes(val)) this.push(val);
    };
    Array.prototype.filterUnique = function(isDomain = false) {
        const newList = [];

        this.map(url => {
            if(!newList.some(u => u.includes(isDomain ? (new URL(url).hostname) : url))) newList.add(url);
        });
        return newList;
    };
    Array.prototype.removeIndex = function(index) {
        var b = '';
        for (b in this) {
          if (this[b] === index) {
            this.splice(b, 1);
            break;
          }
        }
        return this;
    };
    Array.prototype.empty = function() {
        if(isArray(this) && this.length !== 0) return this;
        return null;
    };
    Array.prototype.removeDuplicates = function(key = "", key2 = "") {
        if(valCheck(key) && valCheck(key2)) return this.filter((value, index, self) => index === self.findIndex((t) => t[key][key2] === value[key][key2]));
        if(valCheck(key)) return this.filter((value, index, self) => index === self.findIndex((t) => t[key] === value[key]));
        return this.filter((value, index, array) => array.indexOf(value) === index);
    };
    Array.prototype.randomSelect = function() {
        return this[Math.floor(Math.random()*this.length)];
    };
    Array.prototype.moveToFront = function() {
        // this.map((item, index) => {
        //     if(JSON.stringify(item).includes("pobreflix")) arrayMove(this, index, 0);
        // });
        return this;
    };
    Array.prototype.moveToFrontTerms = function(a, b) {
        const lista = this.filter(item => item[a] === b);
        const listb = this.filter(item => item[a] !== b);

        return [...lista, ...listb];
    };
    Array.prototype.organizerList = function(type = -1) {
        try {
            let listSuccess = [], listFail = [];
    
            switch(type) {
                case v.typeOne: {
                    let list = parseJSON(JSON.stringify(this));

                    list.map((item, index) => {
                        const name = item?.font ?? "";
                        const object = d.fontArray?.filter(item => name.includes(item.font))[0] ?? {};
    
                        if(isObject(object) && !isObjectEmpty(object) && !(object?.done ?? true)) listFail.push(item);
                    });
                    listSuccess = list.filter((item, index) => {
                        const name = item?.font ?? "";
                        const object = d.fontArray?.filter(item => name.includes(item.font))[0] ?? {};
    
                        return (isObject(object) && !isObjectEmpty(object) && (object?.done ?? true)) ? true : false;
                    });
                    listSuccess = (true || v.tagPage === v.homePage) ? [...listSuccess, ...listFail] : [this[0], ...listSuccess, ...listFail];
                    listSuccess.filter(item => valCheck(item?.font ?? ""))[0].class = listSuccess.filter(item => valCheck(item?.font ?? ""))[0].class + " active";
                    
                    // listSuccess.map((item, index) => {
                    //     if(v.tagPage === v.homePage) {
                    //         item.itemTitle = t.titleList[index];
                    //         item.text = t.titleList[index];   
                    //     }
                    //     else if(index > 0) {
                    //         item.itemTitle = t.titleList[index-1];
                    //         item.text = t.titleList[index-1];  
                    //     }
    
                    //     return item;
                    // });
                    break;
                }
                case v.typeTwo: {
                    const defList = v.defList;
                    let list = [], list2 = parseJSON(JSON.stringify(this));
                    
                    defList.map(value => {
                        const item = list2.filter(item => item?.font?.includes(value))[0] ?? {};

                        if(isObject(item) && !isObjectEmpty(item)) list.push(list2.filter(item => item?.font?.includes(value))[0]);
                    });
                    list.map(item => (!(item?.done ?? true)) ? listFail.push(item) : "");
                    listSuccess = list.filter((item, index) => ((item?.done ?? true)) ? true : false);
                    listSuccess = [...listSuccess, ...listFail];
                    break;
                }
                case v.typeTree: {
                    const defList = v.defList;
                    let list = parseJSON(JSON.stringify(this)), list2 = parseJSON(JSON.stringify(this));
    
                    list = list.filter((item, index) => valCheck(item?.font)).map((item, index) => {
                        item.font = defList[index];
                        item.attrs = `${item?.attrs?.split("data-cat-id")[0]} data-cat-id="${defList[index]}"`;
                        return item;
                    });
                    listSuccess = [...list2.filter(item => !valCheck(item?.font)), ...list];
                    break;
                }
                case v.typeFour: {
                    const defList = v.defList;
                    let list = parseJSON(JSON.stringify(this)), list2 = parseJSON(JSON.stringify(this));
    
                    list = list.filter((item, index) => valCheck(item?.font)).map((item, index) => {
                        const i = list2.filter(item => valCheck(item?.font) && item?.font.includes(defList[index]))[0] ?? {};
    
                        if(isObject(i) && !isObjectEmpty(i)) item = i;
                        return item;
                    }).map((item, index) => {
                        item.itemTitle = t.titleList[index];
                        item.text = t.titleList[index];
    
                        return item;
                    });
                    listSuccess = [...list, ...list2.filter(item => !valCheck(item?.font))];
                    break;
                }
            }

            return listSuccess;
            // if(this.length === listSuccess.length) return listSuccess;
            // else return this.organizerList(type);  
        } catch (err) {logs(err)}
        return this;
    };
    Array.prototype.randomTwo = function() {
        this.map((item, index) => { if(index < 2 && Math.random() < 0.5) arrayMove(this, index, 0); });

        return this;
    };
    Array.prototype.organizeTitles = function() {
        return this.map((item, index) => {
            if(index === 0) {
                item.title = t.titlePlayerPrincipal;
                item.desc = t.descPlayerRecomended;
            }
            else {
                item.title = `${t.titlePlayerOpcional} ${(index > 1) ? index : ""}`;
                item.desc = t.descPlayerNoRecomended;
            }

            return item;
        });
    };
    Array.prototype.toRequest = function(type) {
        const list = this.map((item, i) => {
            const elem = $(`<div ${item?.attrs}></div>`);
            const title = item?.text ?? "";
            const url = elem.attr("data-url") ?? "";
            const validator = atob(elem.attr("data-validator") ?? "");

            return {
                index: i,
                itemTitle: title,
                itemDesc: '',
                itemId: (type+title).id(),
                itemScrollType: v.horizontalScrollerElem,
                itemCardType: v.cardPoster,
                itemRandomize: true,
                itemEndless: true,
                itemScrollAlert: v.errorInScroller,
                itemMore: {
                    icon: "./img/left-i.png",
                    action: v.actionOpenCategories
                },
                itemRequestSettings: {
                    convertType: v.convertList,
                    method: v.methodGET,
                    url: url,
                    params: v.tagPage,
                    validator: validator,
                    timeExpire: v.timeExpire5Hour,
                    font: (url.includes("netcine") || url.includes(getDomainName(domains.netcine))) ? v.fontNetcine : url.includes(getDomainName(domains.suatela)) ? v.fontSuatela : url.includes("vizer") ? v.fontVizer : v.fontPobreflix
                },
                itemList: [],
                setItemList: async(index) => {
                    const item = d.pageList[type][index];
                    
                    if(item.index === 0) {
                        item.itemList = await promiseFetch(item);
                        return item;
                    }
                    else {
                        item.isObserver = true;
                        item.itemHtml = requestHtml(v.cardProgress, { 
                            type: v.progressPoster2, 
                            item: item
                        });
                        return item;
                    }
                }
            };
        });
        const topList = [
            {
                
                itemTitle: t.titleTopTen,
                itemDesc: '',
                itemId: `${type}siteTopRated`.id(),
                itemScrollType: v.horizontalScrollerElem,
                itemCardType: v.cardPosterTopRated,
                itemRandomize: false,
                itemEndless: false,
                itemScrollAlert: v.errorInScroller,
                itemRequestSettings: {
                    convertType: v.convertList,
                    method: v.methodGET,
                    url: `${domains.site}/toplist.php?order=views&day=7&limit=10&server=${type}&type=${(v.tagPage === v.seriesPage) ? "serie" : "movie"}`,
                    params: '',
                    validator: '[',
                    timeExpire: v.timeExpire5Hour,
                    font: v.fontSite
                },
                itemList: [],
                setItemList: async(index) => {
                    const item = d.pageList[type][index];
                    
                    item.isObserver = true;
                    item.itemHtml = requestHtml(v.cardProgress, { 
                        type: v.progressPosterTopRated, 
                        item: item
                    });
                    return item;
                }
            },
            {
                itemTitle: t.titleTopTenToday,
                itemDesc: '',
                itemId: `${type}siteTopRatedToday`.id(),
                itemScrollType: v.horizontalScrollerElem,
                itemCardType: v.cardPosterTopRated,
                itemRandomize: false,
                itemEndless: false,
                itemScrollAlert: v.errorInEmpty,
                itemRequestSettings: {
                    convertType: v.convertList,
                    method: v.methodGET,
                    url: `${domains.site}/toplist.php?order=views&day=0&limit=10&server=${type}&type=${(v.tagPage === v.seriesPage) ? "serie" : "movie"}`,
                    params: '',
                    validator: '[',
                    timeExpire: v.timeExpire5Hour,
                    font: v.fontSite
                },
                itemList: [],
                setItemList: async(index) => {
                    const item = d.pageList[type][index];

                    item.isObserver = true;
                    item.itemHtml = requestHtml(v.cardProgress, { 
                        type: v.progressPosterTopRated, 
                        item: item
                    });
                    return item;
                }
            }
        ];
        list.splice(3, 0, ...topList);

        return list;
    };
    Date.prototype.addDays = function(days) {
        this.setDate(this.getDate() + days);
        return this;
    };
    Date.prototype.addHours = function(hours) {
        this.setTime(this.getTime() + (hours*60*60*1000));
        return this;
    };
    Date.prototype.addMinutes = function(minutes) {
        this.setTime(this.getTime() + (minutes * 60000));
        return this;
    };
    String.prototype.getDate = function(d = new Date()) {
        const date = {
            year: (d.getFullYear()),
            month: ((d.getMonth() + 1).toString().padStart(2, "0")),
            day: (d.getDate().toString().padStart(2, "0"))
        };

        return this.toString().replace("yyyy", date.year).replace("dd", date.day).replace("mm", date.month);
        if(this.toString() === "yyyy-mm-dd") return `${date.year}-${date.month}-${date.day}`;
        if(this.toString() === "dd-mm-yyyy") return `${date.day}-${date.month}-${date.year}`;
        return "";
    };
    String.prototype.empty = function(text = "") {
        try {
            return valCheck(this.toString()) ? this.toString() : text;
        } catch (err) {}
        return text;
    };
    String.prototype.encode = function(text) {
        const str = this.toString();
        try {
            const start = 96;
            const len = str.length;
            const out = [...str.toLowerCase()].reduce((out, char, index) => {
                const val = char.charCodeAt(0) - start
                const pow = Math.pow(26, len - index - 1);
                return out + val * pow
            }, 0)
            return out;
        } catch (err) {}
        return str;
    };
