    $.fn.eachToArray = function(data) {
        try {
            const list = [];
            const type = data?.type ?? -1;
            const val = data?.val ?? "";
        
            switch(type) {
                case v.typeAttr: {
                    this.each(function() {
                        const el = $(this);
                
                        if(valCheck(el.attr(val))) list.push(el.attr(val));
                    });
                    break;
                }
                case v.typeText: {
                    this.each(function() {
                        const el = $(this).text().replace(/[^\d.-]/g, '');
                
                        if(valCheck(el) && isNumeric(el)) list.push(el);
                    });
                    break;
                }
            }
            return list;
        } catch (err) {}
        return null;
    };
    $.fn.isInViewport = function() {
        var elementTop = $(this).offset().top;
        var elementBottom = elementTop + $(this).outerHeight();
    
        var viewportTop = $(window).scrollTop();
        var viewportBottom = viewportTop + $(window).height();
    
        return elementBottom > viewportTop && elementTop < viewportBottom;
    };
