        const savedLang = setWithExpiry(v.keyLang, (getParam("lang") ?? "pt"), "30d", true) ?? getParam("lang") ?? "pt";
    
        try {
            const list = callback.langs.filter(country => country.includes(`#${savedLang}`));

            if(isArray(list) && list.length !== 0) return list.some(country => country.includes("english")) ?? !savedLang.includes("pt");
            else return !savedLang.includes("pt");
        } catch (err) {
            return !savedLang.includes("pt");
        }
