            messageKidsProtection: isIngles ?  `<br><div style="color: #ffffff; font-size: 25px; margin-bottom: 5px; font-family: 'Special';">Content unsuitable for children</div> Kids mode is activated in this app and the content has been blocked because it is inappropriate for their age. <br><br> <b>Reasons for blocking</b>: This content contains scenes of sex, violence, nudity, acts of psychological terror and acts inappropriate for your age.` : `<br><div style="color: #ffffff; font-size: 25px; margin-bottom: 5px; font-family: 'Special';">Contedo inadequado para crianas</div> O modo kids esta ativado neste app e o contedo foi bloqueado por ser inadequado para a sua idade. <br><br> <b>Motivos do bloqueio</b>: Esse contedo contem cenas de sexo, violncia, nudez, atos de terror psicolgico e atos inadequados para crianas.`,
            messageDownloadTutorial: isIngles ? `<br><div style="color: #ffffff; font-size: 25px; margin-bottom: 5px; font-family: 'Special';">How to download this video?</div> To download this video, you need to use the <b>Web Video Cast</b> application on your cell phone. See the video tutorial below on how to use the app to download all <b>9MAX</b> videos.` : `<br><div style="color: #ffffff; font-size: 25px; margin-bottom: 5px; font-family: 'Special';">Como baixar esse vdeo?</div> Para baixar esse vdeo, voc precisa usar o aplicativo <b>Web Video Cast</b> em seu celular. Veja o vdeo tutorial abaixo de como usar o app para baixar todos os vdeos do <b>9MAX</b>.`,
