            shareText: `<b>9MAX</b> - Assista a filmes, sries, TV e jogos de futebol ao vivo, so mais de ${Math.floor(Math.random() * (1000 - 10 + 1) + 10)} mil contedos, tudo isso em um nico app totalmente de graa!<br><br>Acesse o site e baixe j o app <br>$`,
            shareText2: `9MAX - Assista a filmes, sries, TV e jogos de futebol ao vivo, so mais de ${Math.floor(Math.random() * (1000 - 10 + 1) + 10)} mil contedos, tudo isso em um nico app totalmente de graa!\n\nAcesse o site e baixe j o app \n$`
