            playlist: (type = -1, any) => {
                const playlist = callback.userDB.getItem(v.storePlaylist);
            
                switch(type) {
                    case v.nextEpisodeSet: {
                        callback.userDB.changeItem(v.replaceSt, v.storePlaylist, { itemId: v.storePlaylist, ...any });
                        break;
                    }
                    case v.nextEpisodeDefault: {
                        const item = {
                            itemId: v.storePlaylist,
                            enableNext: false
                        }
                        callback.userDB.changeItem(v.replaceSt, v.storePlaylist, item);
                        break;
                    }
                    case v.nextEpisodeAdd: {  
                        playlist.itemId = v.storePlaylist;
                        callback.userDB.changeItem(v.replaceSt, v.storePlaylist, { ...playlist, ...any });
                        break;
                    }
                    case v.nextEpisodeReplace: {
                        playlist.itemId = v.storePlaylist;  
                        Object.keys(playlist).map((key, index) => {
                            const newValue = any[key] ?? "";
                            
                            if(newValue !== "") playlist[key] = newValue;
                        });
                        callback.userDB.changeItem(v.replaceSt, v.storePlaylist, playlist);
                        break;
                    }
                    case v.nextEpisodeRemoveKey: {
                        playlist.itemId = v.storePlaylist;
                        any.map(key => delete playlist[key]);
                        callback.userDB.changeItem(v.replaceSt, v.storePlaylist, playlist);
                        break;
                    }
                    default: {
                        return playlist;
                    }
                }
            },
