    async function androidAsyncFetch(key, itemRequestSettings) {
        return await new Promise((resolve, reject) => {
            let retry = 0,
            url = (itemRequestSettings.url.includes("9max")) ? itemRequestSettings.url : domains.site + '/req.php?data=' + btoa(encodeURIComponent(JSON.stringify(itemRequestSettings))),
            isWebView = itemRequestSettings.isWebView ?? false,
            isRejected = false;
            const font = itemRequestSettings.font,
            validator = itemRequestSettings.validator,
            isProxy = itemRequestSettings.url.includes("vizer") || itemRequestSettings.url.includes("pobreflixtv"),
            totalRetrys = isProxy ? 4 : ((itemRequestSettings.retrys === 0) ? 1 : (itemRequestSettings.retrys ?? 3)),
            timeExpire = itemRequestSettings.timeExpire,
            convertType = itemRequestSettings.convertType,
            timeout = itemRequestSettings.timeout ?? (isWebView ? 20000 : 10000),
            id = itemRequestSettings.id ?? "",
            controller = new AbortController(),
            isDev = v.developerMode;
            
            window[key] = {
                resolve: (data, isCached = false, isValid = false) => {
                    if(!isRejected) {
                        const onResolve = () => {
                            resolve(data);
                            callback.fetchPendingPromises.remove(key);
                            delete window[key];
                            if(!isDev && !key.includes("_app") && isCached) window[itemRequestSettings.keyUpdate].update();
                        };
                        const onReject = () => {
                            retry++;
                            window[key].run();
                        };

                        logs(`Fetch cached: ${isCached} || Retry: ${retry} || List: ${itemRequestSettings.url} || Params: ${valCheck(itemRequestSettings.params) ? itemRequestSettings.params : 'no have'}`);
                        if(totalRetrys === 0) onResolve();
                        else if(!isValid && retry < totalRetrys) onReject();
                        else onResolve();
                    }
                    else window[key].reject();
                },
                androidResolve: async(isCached) => {
                    if(!isRejected) {
                        const response = htmlDecode(decodeUri(w.getFetchValue(key)));
                        const resolveData = (isCached) ? (isJsonString(response) ? (JSON.parse(response) ?? response) : response) : (convertElementToJson(convertType, font, (!valCheck(validator) || response.includes(validator)) ? response : v.null, itemRequestSettings.url));
        
                        if(!isDev && valCheck(validator) && response.includes(validator) && !isCached && w) w.putStorage(v.storeCache, key.replace("_app", "_"), timeExpire, encodeURIComponent(JSON.stringify(resolveData)));
                        else if(key.includes("_app") && w) w.removeStorage(v.storeCache, key.replace("_app", "_"));
                        window[key].resolve(resolveData, isCached, (isCached || !valCheck(validator) || response.includes(validator)));
                    }
                    else window[key].reject();
                },
                reject: () => {
                    reject();
                    isRejected = true;
                    callback.fetchPendingPromises.remove(key);
                    if(w) w?.abortAndroidAsyncFetch(valCheck(id) ? id : (itemRequestSettings.url+itemRequestSettings.params));
                    else controller.abort();
                    delete window[key];
                },
                run: () => {
                    if(!isRejected) {
                        itemRequestSettings.request = (retry >= 1) ? 1 : 0;
                        if(totalRetrys === 4 && retry >= totalRetrys && itemRequestSettings.url.includes("pobreflixtv") && !itemRequestSettings.url.includes(callback.domains.bypass)) itemRequestSettings.url = callback.domains.bypass + itemRequestSettings.url;
                        const i = setInterval(() => { 
                            if(document.visibilityState === 'visible') {
                                clearInterval(i);
                                if(window[key]) window[key].resolve(v.null, false, false);
                            } 
                        }, timeout);

                        if(!w || (totalRetrys === 4 && retry >= totalRetrys && itemRequestSettings.url.includes("vizer"))) {
                            fetch(((itemRequestSettings.url.includes(callback.domains.bypass)) ? itemRequestSettings.url : url), { cache: (w) ? "no-cache" : ((timeExpire === 0) ? "no-cache" : "force-cache"), signal: controller.signal })
                            .then(async response => await response.text())
                            .then(async response => {
                                const resolveData = (convertElementToJson(convertType, font, (!valCheck(validator) || response.includes(validator)) ? response : v.null, itemRequestSettings.url)) ?? v.null;
                                
                                if(!isDev && valCheck(validator) && response.includes(validator) && w) w.putStorage(v.storeCache, key.replace("_app", "_"), timeExpire, encodeURIComponent(JSON.stringify(resolveData)));
                                else if(key.includes("_app") && w) w.removeStorage(v.storeCache, key.replace("_app", "_"));
                                if(window[key]) window[key].resolve(resolveData, true, (!valCheck(validator) || response.includes(validator)));
                            })
                            .catch(err => {
                                if(window[key]) window[key].resolve(v.null, false, false);
                            });
                        }
                        else if(w) {
                            if(timeExpire === 0) w.removeStorage(v.storeCache, key.replace("_app", "_"));
                            w.runAsyncFetch(key, JSON.stringify(itemRequestSettings));
                        }
                    }
                    else window[key].reject();
                }
            };
            window[key].run();
        });
    }
